import React from 'react';
import styled from 'styled-components';

const Btn = styled.button`
    width: 100%;
    height: 50px;
    background: black;
    border: none;
    border-radius: 10px;
    font-size: 18px;
    color: white;
    :hover {
        background-color: white;
        color: black;
    }
`

const Button = ({name}) => {
    return <><Btn>{name}</Btn></>
};

export default Button;
